    createMonsters(cardId) {
        var card = this.monsterCards.get(cardId);
        var charactor = this.monsterCharactors.get(cardId);
        if (card != null && charactor != null) {
            var smIdx = -1;
            for (var i = 0; i < this.stageMonsters.length; i++) {
                if (this.stageMonsters[i].cardId == cardId) {
                    smIdx = i;
                }
            }
            var monsterCount = this.getMonsterCount(cardId);
            for (var i = 0; i < monsterCount; i++) {
                var monster = {
                    card: [card],
                    charactor: [charactor],
                    hp: charactor.hp + (this.stageMonsters[smIdx].rank - 1) * charactor.hpLv,
                    sp: charactor.sp + (this.stageMonsters[smIdx].rank - 1) * charactor.spLv,
                    att: charactor.att + (this.stageMonsters[smIdx].rank - 1) * charactor.attLv,
                    def: charactor.def + (this.stageMonsters[smIdx].rank - 1) * charactor.defLv,
                    cardId: cardId,
                    monsterUname: monsterCount == 1 ? card.cardName : card.cardName + (i + 1),
                    status: '', hide: 0
                };
                this.monsters.push(monster);
            }
        }
    }
    loadSiSkills(cardId, ctype) {
        if (ctype == 'S') {
            return;
        }
        this.isLoading = true;
        this.gameService.getSiSkills(cardId).subscribe(e => {
            var skills = [];
            for (var i = 0; i < e.length; i++) {
                var skill = {
                    cardId: e[i].cardId,
                    skillId: e[i].skillId,
                    skillName: e[i].skillName,
                    skillDescription: e[i].skillDescription,
                    power: e[i].power,
                    effect: e[i].effect,
                    sp: e[i].sp
                };
                skills.push(skill);
            }
            ;
            if (ctype == 'M') {
                var monster = this.monsterCards.get(cardId);
                if (monster != null) {
                    monster.skills = skills;
                    this.createMonsters(cardId);
                }
            }
            else if (ctype == 'P') {
                var player = this.playerCards.get(cardId);
                if (player != null) {
                    player.skills = skills;
                    this.createPlayers(cardId);
                }
            }
            this.isLoading = false;
        });
    }
    loadSiCharactor(cardId, ctype) {
        this.isLoading = true;
        this.gameService.getSiCharactor(cardId).subscribe(e => {
            if (e.length == 1) {
                var sichar = {
                    cardId: e[0].cardId,
                    hp: e[0].hp,
                    sp: e[0].sp,
                    att: e[0].att,
                    def: e[0].def,
                    charactorId: e[0].charactorId,
                    effect: e[0].effect,
                    hpLv: e[0].hpLv,
                    spLv: e[0].spLv,
                    attLv: e[0].attLv,
                    defLv: e[0].defLv
                };
                if (ctype == 'M') {
                    this.monsterCharactors.set(cardId, sichar);
                }
                else if (ctype == 'P') {
                    this.playerCharactors.set(cardId, sichar);
                }
                else if (ctype == 'S') {
                    //start loop
                    for (var i = 0; i < this.snacks.length; i++) {
                        if (this.snacks[i].cardId == cardId) {
                            this.snacks[i].charactor = [sichar];
                        }
                    }
                    //end loop
                }
                this.loadSiSkills(cardId, ctype);
            }
            ;
            this.isLoading = false;
        });
    }
